"505063":{"id":"505063","name":"Saída Proibida","slug":"saida-proibida","original_title":"Await Further Instructions","overview":"É dia de Natal e a família Milgram encontra uma misteriosa substância negra ao redor de sua casa. Claramente algo está acontecendo bem à sua porta | Mas o que exatamente está acontecendo? :-seria um acidente industrial, um ataque terrorista, uma guerra nuclear? Apavorados, eles ligam a TV para obter qualquer informação. Na tela uma mensagem brilha sinistramente: 'Fique dentro de casa e aguarde novas instruções'. Como a televisão exerce uma \"atração\" cada vez mais sinistra, a paranóia aumenta e se transforma em uma sangrenta carnificina.","first_air_date":"2018-08-26","runtime":91,"episode_run_time":[91],"vote_average":5.4,"created_by":["Shudder Films","Goldfinch Studios"],"production_companies":[{"name":"Shudder Films"},{"name":"Goldfinch Studios"}],"cast":["David Bradley","Abigail Cruttenden","Holly Weston","Sam Gittins","Grant Masters"],"backdrop_path":"https://image.tmdb.org/t/p/original/kPWABfYVotvqMxJnw8D7Nr6PQUL.jpg","poster_path":"https://image.tmdb.org/t/p/original/s58F5VUMZYv7bbNX5IadOYsR8Oz.jpg","certification":"N/A","genres":["Terror"],"trailer":"N/A"},
"157823":{"id":"157823","name":"Movimentos Noturnos","slug":"movimentos-noturnos","original_title":"Night Moves","overview":"Três ativistas ambientais radicais trabalham juntos para executar o protesto mais intenso de suas vidas: explodir uma barragem hidrelétrica de Oregon – a fonte e símbolo da cultura industrial devoradora de recursos que desprezam. Mas esse ato de terrorismo ambiental levanta muitas questões morais.","first_air_date":"2014-04-23","runtime":112,"episode_run_time":[112],"vote_average":5.8,"created_by":["RT Features","Maybach Film Productions","filmscience"],"production_companies":[{"name":"RT Features"},{"name":"Maybach Film Productions"},{"name":"filmscience"}],"cast":["Jesse Eisenberg","Dakota Fanning","Peter Sarsgaard","Alia Shawkat","Logan Miller"],"backdrop_path":"https://image.tmdb.org/t/p/original/va6SObQdsJV4BmPKts4pTsKIk37.jpg","poster_path":"https://image.tmdb.org/t/p/original/qQj7JKpUfrP7rVvr7kVrKuevGy7.jpg","certification":"N/A","genres":["Thriller","Drama"],"trailer":"N/A"},
"811211":{"id":"811211","name":"Os Jovens Amantes","slug":"os-jovens-amantes","original_title":"Les Jeunes Amants","overview":"Dois amantes se reencontram no corredor de um hospital, 15 anos após o primeiro contato. Shauna tem 71 anos, enquanto Pierre tem 45. Opostos, mas hipnotizados um pelo outro, eles se reconectam, enquanto Shauna, que já é mãe, avó e viúva, quer reafirmar que ainda é uma mulher e que a diferença de idade entre eles não importa.","first_air_date":"2022-02-02","runtime":112,"episode_run_time":[112],"vote_average":6.5,"created_by":["Artémis Productions","Agat Films & Cie / Ex Nihilo","Karé Productions"],"production_companies":[{"name":"Artémis Productions"},{"name":"Agat Films & Cie / Ex Nihilo"},{"name":"Karé Productions"}],"cast":["Fanny Ardant","Melvil Poupaud","Cécile de France","Florence Loiret Caille","Sharif Andoura"],"backdrop_path":"https://image.tmdb.org/t/p/original/1s8Catsbd9n6KrfxQagF3a3jh5I.jpg","poster_path":"https://image.tmdb.org/t/p/original/6zJF4momHB9C2e5S6vpMDmSyr6h.jpg","certification":"14","genres":["Romance","Drama"],"trailer":"5dkWtiYmGpE"},
