"253414":{"id":"253414","name":"Rock em Cabul","slug":"rock-em-cabul","original_title":"Rock the Kasbah","overview":"Richie Vance (Bill Murray) é um empresário decadente, que vive de explorar pessoas sem talento que sonham se tornar grandes astros. Um dia, durante a apresentação de Ronnie (Zooey Deschanel), uma de suas clientes, ele recebe a proposta de levá-la para um show para as tropas americanas localizadas no Afeganistão. De olho no lado financeiro, Richie não pensa duas vezes antes de aceitar. Só que, ao chegar, ela entra em pânico e decide abandonar tudo! Com isto, Richie se vê sem dinheiro, sem passaporte e sem ter o que fazer em pleno Afeganistão em guerra.","first_air_date":"2015-10-22","runtime":100,"episode_run_time":[100],"vote_average":5.4,"created_by":["Shangri-La Entertainment","QED International","Dune Films","Venture Forth","Open Road Films"],"production_companies":[{"name":"Shangri-La Entertainment"},{"name":"QED International"},{"name":"Dune Films"},{"name":"Venture Forth"},{"name":"Open Road Films"}],"cast":["Bill Murray","Zooey Deschanel","Bruce Willis","Kate Hudson","Taylor Kinney"],"backdrop_path":"https://image.tmdb.org/t/p/original/wldeDiuEBhYi1Q4FjSHzAQ3yS80.jpg","poster_path":"https://image.tmdb.org/t/p/original/jGNOsJjpsJ4yWe3InuiXgYk8VuW.jpg","certification":"14","genres":["Comédia","Música","Guerra"],"trailer":"N/A"},
