"245700":{"id":"245700","name":"Sr. Turner","slug":"sr-turner","original_title":"Mr. Turner","overview":"\"Sr. Turner\" explora o último quarto de século da vida do ótimo e excêntrico pintor britânico JMW Turner (1775-1851). Profundamente afetado pela morte de seu pai, amado por sua governanta que ele ocasionalmente explora sexualmente, ele cria uma relação estreita com uma senhoria à beira-mar com quem ele eventualmente vive incógnito no Chelsea, onde ele morre. Enquanto tudo isso acontece ele viaja, pinta, convive com a aristocracia do país, visita bordéis, é um membro popular e anárquico da Royal Academy of Arts, se faz amarrar ao mastro de um navio para que possa pintar uma tempestade de neve e é, ao mesmo tempo, celebrado e insultado pelo público e pela realeza.","first_air_date":"2014-10-31","runtime":150,"episode_run_time":[150],"vote_average":6.5,"created_by":["Film4 Productions","Focus Features","BFI","Diaphana Films","Amusement Park Films","Xofa Productions","France 3 Cinéma","Lipsync Productions","Thin Man Films"],"production_companies":[{"name":"Film4 Productions"},{"name":"Focus Features"},{"name":"BFI"},{"name":"Diaphana Films"},{"name":"Amusement Park Films"},{"name":"Xofa Productions"},{"name":"France 3 Cinéma"},{"name":"Lipsync Productions"},{"name":"Thin Man Films"}],"cast":["Timothy Spall","Dorothy Atkinson","Marion Bailey","Paul Jesson","Lesley Manville"],"backdrop_path":"https://image.tmdb.org/t/p/original/74IaLYwgko2nTLj8Gz9ukQ4RIvC.jpg","poster_path":"https://image.tmdb.org/t/p/original/1eDlM1Zq63o2lTNqz1p50qASYY7.jpg","certification":"e 12","genres":["História","Drama"],"trailer":"N/A"},
