"261101":{"id":"261101","name":"Cantinflas: A Magia da Comédia","slug":"cantinflas-a-magia-da-comedia","original_title":"Cantinflas","overview":"Mario Moreno (Óscar Jaenada) sai de sua origem humilde para atuar e fazer o público rir. Ele passa a ser conhecido como Cantiflas, a maior estrela dos filmes de comédia mexicanos. Cantiflas encanta o público com seu estilo leve de fazer comédia. Em seu caminho surge Michael Todd (Michael Imperioli), um produtor da Broadway que luta para produzir uma versão de \"Volta ao Mundo em 80 Dias\". Quando os dois se tornam parceiros, o sucesso é inevitável.","first_air_date":"2014-08-29","runtime":102,"episode_run_time":[102],"vote_average":6.6,"created_by":["Bullet Films","Kenio Films","Videocine"],"production_companies":[{"name":"Bullet Films"},{"name":"Kenio Films"},{"name":"Videocine"}],"cast":["Óscar Jaenada","Michael Imperioli","Luis Gerardo Méndez","Ilse Salas","Ximena Rubio"],"backdrop_path":"https://image.tmdb.org/t/p/original/cqk0C16cGar0CNAtckk5Ztbik1B.jpg","poster_path":"https://image.tmdb.org/t/p/original/dNLQZKH20mEP5PhwnDHCy8aUKhO.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"381325":{"id":"381325","name":"O Exorcismo de Anna Ecklund","slug":"o-exorcismo-de-anna-ecklund","original_title":"The Exorcism of Anna Ecklund","overview":"Nesta história real terrível, algo além da compreensão está acontecendo com a esposa e mãe Anna Ecklund. Uma vez uma paroquiana calma e educada, ela agora está propensa a ataques de raiva, com um ódio particularmente violento contra imagens religiosas. Desesperado para encontrar uma cura para o comportamento perturbador de Anna, sua família convida médicos e psiquiatras para fornecer um diagnóstico. Mas quando nenhuma explicação racional pode ser encontrada, o sacerdote local Padre Riesinger se une ao investigador do Vaticano Padre Lamont para avaliar o caso. Percebendo que Anna está possuída por uma entidade malévola, os sacerdotes a levam para um convento nas proximidades para realizar um exorcismo. Mas todo o inferno é libertado e uma batalha brutal começa entre o bem e o mal.","first_air_date":"2016-03-07","runtime":80,"episode_run_time":[80],"vote_average":3.5,"created_by":["North Bank Entertainment"],"production_companies":[{"name":"North Bank Entertainment"}],"cast":["Lee Bane","Tiffany Ceri","Jeffrey Raggett","Judith Haley","Rik Grayson"],"backdrop_path":"https://image.tmdb.org/t/p/original/2hovrozDQMFJTTk9LNc18y2c02U.jpg","poster_path":"https://image.tmdb.org/t/p/original/wJ8thYCnYnDefYirsYaS2ge5vuq.jpg","certification":"N/A","genres":["Thriller","Terror"],"trailer":"gpozl-n9X_M"},
