"447682":{"id":"447682","name":"Limites","slug":"limites","original_title":"Boundaries","overview":"Laura (Vera Farmiga) é uma mulher que busca viver uma vida tranquila e que faz o possível para ajudar as pessoas. No entanto, seus desejos e sua generosidade característica entram em conflito quando ela precisa levar Jack (Christopher Plummer), um homem que é seu pai e também é um criminoso, em uma viagem de carro do Texas até a Califórnia. Os dois e Henry, filho de Laura, que também vai junto, vão aprender da maneira mais confusa e difícil o que significa ser uma família.","first_air_date":"2018-06-22","runtime":104,"episode_run_time":[104],"vote_average":5.7,"created_by":["Oddfellows Entertainment","Automatik Entertainment"],"production_companies":[{"name":"Oddfellows Entertainment"},{"name":"Automatik Entertainment"}],"cast":["Vera Farmiga","Christopher Plummer","Lewis MacDougall","Bobby Cannavale","Kristen Schaal"],"backdrop_path":"https://image.tmdb.org/t/p/original/wKrJ0GQaB6mDI3vx6JUlKukJT2.jpg","poster_path":"https://image.tmdb.org/t/p/original/qGNaVQQ2v1AEyp6K07vdWRj0cxX.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
