"180951":{"id":"180951","name":"A Arte da Paixão","slug":"a-arte-da-paixao","original_title":"Summer in February","overview":"O filme é inspirado no livro homônimo de Jonathan Smith, que também assina o roteiro da adaptação. Inspirada na vida do pintor Alfred James Munnings, a trama acompanha uma mulher (Emily Browning) dividida entre dois homens, que logo se arrepende pela decisão de se casar com o infiel artista (Dominic Cooper). A direção é de Christopher Menaul (série “Combat Hospital”). No começo do século XX, uma escola de artistas britânica reuniu alguns dos maiores talentos da época, como o rebelde Alfred Munnings, além de Harold e Laura Knight. Neste contexto, dois aspirantes a artistas começam um romance: Florence Carter-Wood e Gilbert Evans. No entanto, Florence começa a se apaixonar por Alfred, e abandona Gilbert para ficar com o talentoso pintor. Mesmo assim, o coração dela está dividido.","first_air_date":"2013-06-13","runtime":101,"episode_run_time":[101],"vote_average":5.4,"created_by":["Marwood Pictures","Apart Films","CrossDay Productions"],"production_companies":[{"name":"Marwood Pictures"},{"name":"Apart Films"},{"name":"CrossDay Productions"}],"cast":["Dominic Cooper","Emily Browning","Dan Stevens","Hattie Morahan","Mia Austen"],"backdrop_path":"https://image.tmdb.org/t/p/original/oPeJdQLq4p3dYb1dup7UgLd0ENc.jpg","poster_path":"https://image.tmdb.org/t/p/original/2kPtzxEyikQEE2wuA1klSsJdLV9.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
