"3598":{"id":"3598","name":"Horizonte Perdido","slug":"horizonte-perdido","original_title":"Lost Horizon","overview":"Após a queda de um avião no Himalaia, grupo de pessoas acaba por encontrar uma cidade perdida. O lugar é o paraíso, Shangri-La, onde eles encontram um enorme contraste com a vida urbana que levam.\r Uma revolução eclodiu na China e o diplomata Robert Conway (Ronald Colman) é forçado a fugir com outros quatro americanos. Mas o avião deles é sequestrado e acabam indo parar no Tibet, precisamente numa comunidade utópica em que seus membros parecem não envelhecer.\r A obra-prima original, de Frank Capra tinha duração de 132 minutos na época de seu lançamento, em 1937. Durante a Segunda Guerra Mundial, uma nova edição, com 24 minutos a menos, atenuou a mensagem pacifista do filme. Num trabalho de mais de 25 anos para restaurar o filme, foram utilizadas cenas encontradas em várias partes do mundo. Com uma ótima direção de arte, o destaque fica para os cenários de Shangri-la que são considerados os maiores já construídos em Hollywood.","first_air_date":"1937-03-03","runtime":97,"episode_run_time":[97],"vote_average":7.0,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Ronald Colman","Jane Wyatt","Edward Everett Horton","John Howard","Thomas Mitchell"],"backdrop_path":"https://image.tmdb.org/t/p/original/fi7ZCnJ6TeZTFf4NHnz8ns3SW6.jpg","poster_path":"https://image.tmdb.org/t/p/original/zx5bqZsj1I9KrlxxldNUmPOCatw.jpg","certification":"N/A","genres":["Aventura","Fantasia","Drama","Romance"],"trailer":"N/A"},
"63207":{"id":"63207","name":"Intrusos","slug":"intrusos","original_title":"Intruders","overview":"Filme conta a história de duas crianças assombradas. Juan, de sete anos, mora em um bairro pobre de Madri e é atacado por um intruso sem nome em seus pesadelos, sem que sua mãe possa ajudá-lo. Mia, de 12 anos, por sua vez, conta a seus colegas de sala um conto de monstro, no mesmo dia em que seu pai sofre um acidente do arranha-céus em construção, onde trabalha.","first_air_date":"2011-09-12","runtime":99,"episode_run_time":[99],"vote_average":5.5,"created_by":["Apaches Films","Universal Pictures International","Ministerio de Cultura","Canal+ España","Atresmedia"],"production_companies":[{"name":"Apaches Films"},{"name":"Universal Pictures International"},{"name":"Ministerio de Cultura"},{"name":"Canal+ España"},{"name":"Atresmedia"}],"cast":["Clive Owen","Carice van Houten","Ella Purnell","Adrian Rawlins","Daniel Brühl"],"backdrop_path":"https://image.tmdb.org/t/p/original/5xkUNp36OqJLm7ERfVIEinZrxQW.jpg","poster_path":"https://image.tmdb.org/t/p/original/j4TJv3s7fG89KaZsavrV1IsSERN.jpg","certification":"N/A","genres":["Thriller","Terror","Fantasia"],"trailer":"N/A"},
