"38724":{"id":"38724","name":"Deus Sabe Quanto Amei","slug":"deus-sabe-quanto-amei","original_title":"Some Came Running","overview":"Em 1948, o escritor Dave Hirsh retorna à sua cidade natal de Parkman, Indiana. Ele deixou o exército e não tem certeza do que vai fazer para o resto de sua vida, embora não deseje ser um escritor. Não tem certeza do por que está voltado para casa. Não se dá bem com seu irmão mais velho Frank e nem com sua cunhada Agnes, que o odeia. Logo se encontra com um jogador profissional Bama Dillert e se tornam grandes amigos. Também tem que lidar com Ginnie Moorehead, uma garota que conheceu em Chicago na noite da sua partida e ela decidiu ir junto. Não planeja ficar na cidade por muito tempo até que conhece Dawn French uma professora de redação criativa na universidade local e uma fervorosa admiradora de suas obras anteriores. Ele se apaixona por ela, mas ela não é tão rápida em se apaixonar por ele.","first_air_date":"1958-12-25","runtime":137,"episode_run_time":[137],"vote_average":6.9,"created_by":["Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"}],"cast":["Frank Sinatra","Dean Martin","Shirley MacLaine","Martha Hyer","Arthur Kennedy"],"backdrop_path":"https://image.tmdb.org/t/p/original/nC57cswfpk1a3sXQjwp5dwxinMl.jpg","poster_path":"https://image.tmdb.org/t/p/original/k55QCBe8XlqVozNe0bwfTy22Rxs.jpg","certification":"e 16","genres":["Drama","Romance"],"trailer":"N/A"},
