"429742":{"id":"429742","name":"O Enviado Do Mal","slug":"o-enviado-do-mal","original_title":"Still/Born","overview":"A jovem Mary passa por um momento difícil, uma mistura de alegria e tristeza: ela acaba de se tornar mãe de gêmeos, entretanto, apenas uma das crianças sobreviveu. No meio desse turbilhão de emoções, Mary enfrenta não só as dificuldades de ser mãe, como também vê seu casamento em crise e passa a ser atormentada por visões assustadoras de uma mulher querendo tomar seu filho. Com a sanidade questionada, a jovem precisa lutar para salvar seu menino e evitar que essa entidade maligna destrua sua família.","first_air_date":"2018-02-09","runtime":87,"episode_run_time":[87],"vote_average":5.8,"created_by":["Hadron Films"],"production_companies":[{"name":"Hadron Films"}],"cast":["Christie Burke","Jesse Moss","Rebecca Olson","Jenn Griffin","Sheila McCarthy"],"backdrop_path":"https://image.tmdb.org/t/p/original/nvxj7TwfyY9j2AnQDaNkLawaHAn.jpg","poster_path":"https://image.tmdb.org/t/p/original/dUHZRSD38BV5y0SSlpdRMfIxYHm.jpg","certification":"N/A","genres":["Terror"],"trailer":"N/A"},
