"482710":{"id":"482710","name":"A Última Loucura de Claire Darling","slug":"a-ultima-loucura-de-claire-darling","original_title":"La Dernière Folie de Claire Darling","overview":"Em Verderonne, uma pequena aldeia na região do Rio Oise, é o primeiro dia de verão e Claire Darling acorda convencida de que está vivendo seu último dia. Ela decide então esvaziar sua casa e se livra tudo, sem distinção. Seus objetos amados ecoam uma vida trágica e extravagante. Esta última loucura traz de volta Mary, sua filha, a quem ela não via há 20 anos.","first_air_date":"2019-02-06","runtime":94,"episode_run_time":[94],"vote_average":5.5,"created_by":["Les Films du Poisson"],"production_companies":[{"name":"Les Films du Poisson"}],"cast":["Catherine Deneuve","Chiara Mastroianni","Alice Taglioni","Olivier Rabourdin","Samir Guesmi"],"backdrop_path":"https://image.tmdb.org/t/p/original/4BV57N0oLGkuraqjpcoBEbS3klp.jpg","poster_path":"https://image.tmdb.org/t/p/original/yKfOtnHB9yKxwTjqgZVZ5wYMbRV.jpg","certification":"N/A","genres":["Drama"],"trailer":"1BPevAxZcmE"},
"9515":{"id":"9515","name":"O Matador","slug":"o-matador","original_title":"The Matador","overview":"Bem no estilo Tarantino, com muita violência, O Matador nos traz dois tipos opostos procurando uma saída para seus problemas. Em um bar na Cidade do México, dois profissionais de ramos diferentes se encontram: Danny é um vendedor cujas finanças e casamento estão na pior e Julian é um assassino de aluguel que se diverte como pode, sem pensar nas consequências. Os dois estão em crise: o bom cidadão não está progredindo muito na vida e o seu oposto, o fora da lei, depois de anos matando sem pestanejar, começa a desenvolver uma consciência. Eles acham amizade onde ninguém poderia imaginar e se ajudam de forma surpreendente.","first_air_date":"2005-05-12","runtime":96,"episode_run_time":[96],"vote_average":6.3,"created_by":["Stratus Film Co.","DEJ Productions","Equity Pictures Medienfonds GmbH & Co. KG II","Furst Films","Irish Dreamtime","Bob Yari Productions","Arclight Films","Jade Films"],"production_companies":[{"name":"Stratus Film Co."},{"name":"DEJ Productions"},{"name":"Equity Pictures Medienfonds GmbH & Co. KG II"},{"name":"Furst Films"},{"name":"Irish Dreamtime"},{"name":"Bob Yari Productions"},{"name":"Arclight Films"},{"name":"Jade Films"}],"cast":["Pierce Brosnan","Greg Kinnear","Hope Davis","Portia Dawson","Adam Scott"],"backdrop_path":"https://image.tmdb.org/t/p/original/jBxIfffFWY69oAx6CLQtKZ3xtYO.jpg","poster_path":"https://image.tmdb.org/t/p/original/oJnlAGmrhsg4QrlVKGgP91J6WPu.jpg","certification":"N/A","genres":["Ação","Comédia","Crime","Drama","Thriller"],"trailer":"N/A"},
