"19147":{"id":"19147","name":"O Homem Que Desafiou o Diabo","slug":"o-homem-que-desafiou-o-diabo","original_title":"O Homem Que Desafiou o Diabo","overview":"Ao chegar à cidade de Jardim dos Caiacós, o caixeiro viajante Zé Araújo (Marcos Palmeira) acaba seduzindo a filha de um comerciante e é obrigado a se casar com ela. A partir de então, a liberdade dele termina e ele se torna um escravo do sogro nas vendas e da mulher na cama. Ao perceber que se tornou alvo de brincadeiras na cidade, Araújo decide acabar com a vida que está levando e começar uma nova, desta vez como Ojuara.","first_air_date":"2007-09-28","runtime":106,"episode_run_time":[106],"vote_average":7.0,"created_by":["Warner Bros. Pictures","Globo Filmes","LC Barreto"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Globo Filmes"},{"name":"LC Barreto"}],"cast":["Marcos Palmeira","Flávia Alessandra","Fernanda Paes Leme","Lívia Falcão","Antônio Pitanga"],"backdrop_path":"https://image.tmdb.org/t/p/original/oSJATB2im4dPGWx9h8162JIiulo.jpg","poster_path":"https://image.tmdb.org/t/p/original/ie5sQLxoOzga7YdVHFm8dL5nKgQ.jpg","certification":"16","genres":["Comédia","Drama"],"trailer":"unR8IWULFWA"},
