"319076":{"id":"319076","name":"A verdade sobre Marlon Brando","slug":"a-verdade-sobre-marlon-brando","original_title":"Listen to Me Marlon","overview":"Com acesso exclusivo ao arquivo pessoal, este é o documentário cinematográfico definitivo de Marlon Brando. Traçando sua carreira excepcional como ator e extraordinária vida fora do palco e da tela; o filme explorará totalmente as complexidades do homem, contando a história exclusivamente da perspectiva de Marlon. Não há entrevistadores, nem cabeças falantes, apenas Marlon nos guiando nessa odisséia criativa na mente e na motivação de um enigma.","first_air_date":"2015-07-29","runtime":103,"episode_run_time":[103],"vote_average":7.5,"created_by":["Passion Pictures","Cutler Productions"],"production_companies":[{"name":"Passion Pictures"},{"name":"Cutler Productions"}],"cast":["Marlon Brando","Stella Adler","Bette Davis","Montgomery Clift","Anna Kashfi"],"backdrop_path":"https://image.tmdb.org/t/p/original/5I04axlDeS3wvdOy2pIUXGRGmgr.jpg","poster_path":"https://image.tmdb.org/t/p/original/nC0G7Fdd8C6EygAUkA9RizNpRdl.jpg","certification":"N/A","genres":["Documentário"],"trailer":"N/A"},
