"19637":{"id":"19637","name":"Chup Chup Ke","slug":"chup-chup-ke","original_title":"चुप चुप के","overview":"Um jovem endividado tenta o suicídio, mas é resgatado apenas para descobrir que sua sorte finalmente está mudando.\r Jeetu [Shahid Kapoor] é um cara de cidade pequena que está sempre em dívida e esquivando-se dos credores e agiotas. Seu pai um professor aposentado, e sua noiva Pooja são obrigados a sofrer as conseqüências da sua instabilidade e de suas dívidas. O pai de Pooja também considera que Jeetu não é digno de Pooja e incentiva ela a casar-se com outra pessoa, o que ela não concorda. Jeetu tenta cometer suicídio pulando no mar, de modo que sua família possa reclamar o seu seguro de vida e pagar suas dívidas. Mas Jeetu é salvo por um par de pescadores, Gundya e Bandya. Ao descobrir que Jeetu foi capturado como uma sereia em sua rede, Gundya e Bandya descobrem uma nota no bolso de Jeetu o que os leva a pensar que ele é um milionário.","first_air_date":"2006-06-09","runtime":165,"episode_run_time":[165],"vote_average":6.2,"created_by":["UTV Motion Pictures"],"production_companies":[{"name":"UTV Motion Pictures"}],"cast":["Shahid Kapoor","Paresh Rawal","Rajpal Yadav","Kareena Kapoor Khan","Neha Dhupia"],"backdrop_path":"https://image.tmdb.org/t/p/original/9c4soJ1f1IPAyoCj0CDwKNThsBV.jpg","poster_path":"https://image.tmdb.org/t/p/original/daXoADAtEPis5bBvSrXVWfRa77X.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
