"2787":{"id":"2787","name":"Eclipse Mortal","slug":"eclipse-mortal","original_title":"Pitch Black","overview":"No futuro, as viagens interplanetárias são corriqueiras e o homem conhece boa parte do universo. Durante uma viagem tripulada por centenas de pessoas rumo ao planeta New Mecca, um acidente ocorre e a nave é obrigada a pousar num planeta desconhecido. De toda a tripulação, apenas seis pessoas sobrevivem à queda, que descobrem estar num planeta povoado por milhares de criaturas carnívoras, que hibernam nas cavernas locais, mas que irão caçar em céu aberto com a chegada do próximo eclipse. A única arma que eles têm contra os monstros é a claridade, mas mesmo assim o planeta não possui eletricidade e as baterias de seus trajes estão esgotando.","first_air_date":"2000-02-18","runtime":108,"episode_run_time":[108],"vote_average":6.8,"created_by":["Interscope Communications"],"production_companies":[{"name":"Interscope Communications"}],"cast":["Vin Diesel","Radha Mitchell","Cole Hauser","Lewis Fitz-Gerald","Claudia Black"],"backdrop_path":"https://image.tmdb.org/t/p/original/38Y65sf9O4zLq6Ke2KdpANYk0G3.jpg","poster_path":"https://image.tmdb.org/t/p/original/7V4WfCUWYzMcBby8e6jAwVxw2Ai.jpg","certification":"14","genres":["Thriller","Ficção científica","Ação"],"trailer":"bvSN25hHoHM"},
