"41975":{"id":"41975","name":"Um Assunto de Mulheres","slug":"um-assunto-de-mulheres","original_title":"Une affaire de femmes","overview":"Durante a Segunda Guerra Mundial, na França ocupada, uma mulher de baixa escolaridade cria seus dois filhos em um apartamento cheio de ratos. Ela é Marie Latour. Em 1941, seu marido retorna da Frente, fraco demais para manter um emprego. Depois de um episódio envolvendo sua vizinha, Marie descobre que pode fazer abortos clandestinos para sustentar sua família.","first_air_date":"1988-09-14","runtime":108,"episode_run_time":[108],"vote_average":7.3,"created_by":["Films A2","Films du Camélia","Sofinergie Films","MK2 Films"],"production_companies":[{"name":"Films A2"},{"name":"Films du Camélia"},{"name":"Sofinergie Films"},{"name":"MK2 Films"}],"cast":["Isabelle Huppert","François Cluzet","Nils Tavernier","Marie Trintignant","Guillaume Foutrier"],"backdrop_path":"https://image.tmdb.org/t/p/original/uVyHoOtk7N1e3aEoHIuJbT6IBJg.jpg","poster_path":"https://image.tmdb.org/t/p/original/gNYGQwXpgW6T3QNy42f4uQnzD97.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"324562":{"id":"324562","name":"As Tribos de Palos Verdes","slug":"as-tribos-de-palos-verdes","original_title":"The Tribes of Palos Verdes","overview":"Dois irmãos adolescentes, Medina (Maika Monroe) e Jim (Cody Fern) têm de se readaptarem quando mudam com os pais para uma cidade praiana da região de Palos Verdes, na Califórnia. O clima em casa não é nada bom, pois a mãe (Jennifer Garner) sofre um colapso nervoso e o pai fica cada vez mais ausente por causa de seu trabalho como cirurgião plástico de estrelas de Hollywood. Desanimada, Medina começa a surfar para esquecer os problemas domésticos.","first_air_date":"2017-12-01","runtime":104,"episode_run_time":[104],"vote_average":5.4,"created_by":["Relativity Media","The Mark Gordon Company"],"production_companies":[{"name":"Relativity Media"},{"name":"The Mark Gordon Company"}],"cast":["Maika Monroe","Jennifer Garner","Cody Fern","Justin Kirk","Noah Silver"],"backdrop_path":"https://image.tmdb.org/t/p/original/y4tXfE2Cyvlw7BaTHxW1GnZSrO7.jpg","poster_path":"https://image.tmdb.org/t/p/original/fsjsaF3MOXz7zBz4Y9KLNJWmN4v.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
