"505945":{"id":"505945","name":"Marvel One Shot: Equipe Darryl","slug":"marvel-one-shot-equipe-darryl","original_title":"Team Darryl","overview":"Depois que Thor se vai, Darryl começa a procura por um novo colega de quarto. Infelizmente, apenas uma pessoa responde seu anúncio: o Grão-Mestre.","first_air_date":"2018-02-20","runtime":6,"episode_run_time":[6],"vote_average":6.2,"created_by":["Marvel Studios"],"production_companies":[{"name":"Marvel Studios"}],"cast":["Jeff Goldblum","Daley Pearson","Zach Campa","Chris Hemsworth","Rachel House"],"backdrop_path":"https://image.tmdb.org/t/p/original/wL56346BF1eMElIGtqWLiILcfbU.jpg","poster_path":"https://image.tmdb.org/t/p/original/p23Jd3et1qj06Nmg8gDX9Nc2WYj.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
"1779":{"id":"1779","name":"Roger e Eu","slug":"roger-e-eu","original_title":"Roger & Me","overview":"Quando o cineasta realizador de documentários Michael Moore fez seu primeiro trabalho importante, Roger and Me, literalmente niguém acredita nele, e não era para menos: o que se propunha era pedir explicacões a Roger Smith, presidente da General Motors, pelo fechamento de onze fábricas na cidade de Flint (cidade natal de Moore, no estado de Michigan) que deixou 30.000 pessoas sem trabalho. O mais flagrante era que as fábricas automomobilisticas deixavam um superávit milionário. Durante dois anos Moore tentou sem êxito entrevistar Roger Smith mas entretanto fez o retrato de um cidade que um dia foi modelo de bem-estar e entrou na miséria por uma decisão da mesma companhia que a levantou.","first_air_date":"1989-09-01","runtime":91,"episode_run_time":[91],"vote_average":7.1,"created_by":["Dog Eat Dog Films","Warner Bros. Pictures"],"production_companies":[{"name":"Dog Eat Dog Films"},{"name":"Warner Bros. Pictures"}],"cast":["Michael Moore","Rhonda Britton","Fred Ross","Roger B. Smith","Bob Eubanks"],"backdrop_path":"https://image.tmdb.org/t/p/original/1rcqMsFdegP8maBBjn3whEqf6wR.jpg","poster_path":"https://image.tmdb.org/t/p/original/3F8Y872GdFRdRA7LyTUmbAbg01P.jpg","certification":"N/A","genres":["Documentário","História","Comédia"],"trailer":"N/A"},
