"347881":{"id":"347881","name":"Um Fim de Semana Diferente","slug":"um-fim-de-semana-diferente","original_title":"The Confirmation","overview":"A trama do filme acompanha um pai (Owen) que passa dois dias com o filho pequeno (Jaeden Lieberher) após a mãe dele (Maria Bello) ir para um retiro religioso com o novo marido (Matthew Modine). Nesse meio tempo, o seu caminhão quebra, ele é despejado do seu apartamento e a sua caixa de ferramentas é roubada. Os dois passam a procurar a caixa de ferramentas com o auxílio de um vizinho estranho (Patton Oswalt), ao mesmo tempo em que pai e filho finalmente começam a estabelecer uma conexão.","first_air_date":"2016-03-18","runtime":101,"episode_run_time":[101],"vote_average":6.4,"created_by":["Lighthouse Pictures","Bungalow Media + Entertainment","Sapphire Fire Limited"],"production_companies":[{"name":"Lighthouse Pictures"},{"name":"Bungalow Media + Entertainment"},{"name":"Sapphire Fire Limited"}],"cast":["Clive Owen","Jaeden Martell","Maria Bello","Tim Blake Nelson","Patton Oswalt"],"backdrop_path":"https://image.tmdb.org/t/p/original/6TMMB8aubywndZDH658Tu1l6HuT.jpg","poster_path":"https://image.tmdb.org/t/p/original/dpbMAriV0NX97L4GpeKVBG30ZCZ.jpg","certification":"12","genres":["Drama","Comédia"],"trailer":"N/A"},
"589985":{"id":"589985","name":"Aonde Quer Que Você Vá","slug":"aonde-quer-que-voce-va","original_title":"J'irai où tu iras","overview":"Vali e Mina são duas irmãs com personalidades completamente opostas, separadas pelas dificuldades e provações da vida. Vali é uma cantora sonhadora e emotiva, enquanto Mina é uma terapeuta distante e racional. Quando Vali decide fazer um teste para um coral de músicas de Céline Dion, Léon, o amoroso pai das duas irmãs, encontra a oportunidade perfeita para reuni-las, mesmo que apenas por um fim de semana.","first_air_date":"2019-10-02","runtime":100,"episode_run_time":[100],"vote_average":5.7,"created_by":["Mars Film","France 2 Cinéma","Nord-Ouest Films","Jobi"],"production_companies":[{"name":"Mars Film"},{"name":"France 2 Cinéma"},{"name":"Nord-Ouest Films"},{"name":"Jobi"}],"cast":["Leïla Bekhti","Géraldine Nakache","Patrick Timsit","Pascale Arbillot","Célia Pilastre"],"backdrop_path":"https://image.tmdb.org/t/p/original/oxTxskIqUNWcniB7qgCHSifCwmc.jpg","poster_path":"https://image.tmdb.org/t/p/original/hCmFl8gJLF0lyMxXl7miCtUu22T.jpg","certification":"L","genres":["Comédia","Drama"],"trailer":"djTzqUVGxxU"},
