"358881":{"id":"358881","name":"Os Caminhos do Terror","slug":"os-caminhos-do-terror","original_title":"Made in France","overview":"Sam é um jornalista independente que aproveita o fato de conhecer bastante da cultura muçulmana para se infiltrar nos grupos fundamentalistas nos subúrbios de Paris. Ele se aproxima de um grupo de quatro jovens e descobre que para eles fora dada a tarefa de criar uma célula jihadista para semear o caos na cidade de Paris.","first_air_date":"2015-10-04","runtime":103,"episode_run_time":[103],"vote_average":6.2,"created_by":["Radar Films","Pretty Pictures"],"production_companies":[{"name":"Radar Films"},{"name":"Pretty Pictures"}],"cast":["Malik Zidi","Dimitri Storoge","François Civil","Nassim Lyes","Ahmed Dramé"],"backdrop_path":"https://image.tmdb.org/t/p/original/siPgtwifsrTCZOE1RPfLaWGAbp5.jpg","poster_path":"https://image.tmdb.org/t/p/original/agKhGhwdtsfIxWxcVA6LQDQwTp7.jpg","certification":"N/A","genres":["Drama","Thriller"],"trailer":"N/A"},
"32059":{"id":"32059","name":"O Calendário da Morte","slug":"o-calendario-da-morte","original_title":"The January Man","overview":"Nick Starkey (Kevin Kline) é um ex-policial de Nova York, que agora é bombeiro por ter sido obrigado a se afastar devido a um escândalo. Nick é requisitado a voltar à ativa quando um serial killer mata sua décima primeira vítima na véspera do Ano Novo. Seu irmão (Harvey Keitel), que trabalha na polícia, não vê este retorno com bons olhos, principalmente pelo fato da sua mulher (Susan Sarandon) se sentir atraída pelo seu irmão. Porém Nick se envolve com a filha do prefeito e gradativamente descobre que os crimes são cometidos em datas e locais pré-determinados, seguindo um padrão específico. Assim ele acredita que possa estar no local do atentado antes do assassinato ser cometido, mas ninguém lhe dá crédito, com exceção da namorada e de um amigo que é pintor.","first_air_date":"1989-01-13","runtime":97,"episode_run_time":[97],"vote_average":4.9,"created_by":["Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"}],"cast":["Kevin Kline","Susan Sarandon","Mary Elizabeth Mastrantonio","Harvey Keitel","Danny Aiello"],"backdrop_path":"https://image.tmdb.org/t/p/original/6KUNcsjzLUmRwahwzNr5876HcIJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/pFj6xZB8Ak2Wwg7qOzyi2keqDbt.jpg","certification":"N/A","genres":["Crime","Mistério","Thriller","Comédia"],"trailer":"N/A"},
"330298":{"id":"330298","name":"Uma Dama de Óculos Escuros Com uma Arma no Carro","slug":"uma-dama-de-oculos-escuros-com-uma-arma-no-carro","original_title":"La Dame dans l'auto avec des lunettes et un fusil","overview":"A jovem Dany (Freya Mavor) trabalha como secretária do empresário Michel (Benjamin Biolay). Ela é secretamente atraída pelo chefe, mas ele está casado com uma antiga amiga sua, Anita (Stacy Martin). Cansada de ver Anita levando uma vida confortável enquanto ela tem uma rotina banal, Dany se vê um dia em posse do carro de luxo de Michel. Ao invés de devolver o veículo como prometido, ela começa a dirigir rumo ao sul da França, na intenção de ver o mar pela primeira vez. Mas esta decisão impensada trará consequências trágicas a Dany.","first_air_date":"2015-08-05","runtime":93,"episode_run_time":[93],"vote_average":5.1,"created_by":["Versus Production","Alicéléo"],"production_companies":[{"name":"Versus Production"},{"name":"Alicéléo"}],"cast":["Freya Mavor","Stacy Martin","Benjamin Biolay","Elio Germano","Thierry Hancisse"],"backdrop_path":"https://image.tmdb.org/t/p/original/lo8MennKBzgRu2MzE2KLA7W8BEQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/3oKIk8w83KndbRoPePuqfwFDmWI.jpg","certification":"N/A","genres":["Thriller","Drama","Crime","Mistério"],"trailer":"N/A"},
"192133":{"id":"192133","name":"Jimi: Tudo a Meu Favor","slug":"jimi-tudo-a-meu-favor","original_title":"Jimi: All Is by My Side","overview":"O filme foca no período em que Jimi Hendrix (Andre Benjamin) iniciou sua carreira como guitarrista de apoio em clubes de Nova York. Ele é descoberto por Linda Keith (Imogen Poots), uma modelo apaixonada por música que na época namorava o guitarrista Keith Richards (Ashley Charles). Ela acredita no potencial de Hendrix e o convence a se mudar para Londres e gravar um disco, que seria o clássico \"Are you Experienced\", com a banda Jimi Hendrix Experience. O filme termina um pouco antes da clássica apresentação de Hendrix no Monterey Pop Festival, onde a uma apresentação flamejante e uma guitarra em chamas entrariam para a história do rock &amp; roll.","first_air_date":"2013-09-07","runtime":118,"episode_run_time":[118],"vote_average":5.6,"created_by":["Subotica","Darko Entertainment","Freeman Film"],"production_companies":[{"name":"Subotica"},{"name":"Darko Entertainment"},{"name":"Freeman Film"}],"cast":["André 3000","Hayley Atwell","Imogen Poots","Burn Gorman","Ruth Negga"],"backdrop_path":"https://image.tmdb.org/t/p/original/cgLiIJe1aW0J007EUUnWUpMX2Wt.jpg","poster_path":"https://image.tmdb.org/t/p/original/4FRGJC7ofGhGiAcCWkSwixut6D6.jpg","certification":"16","genres":["Drama","Música"],"trailer":"N/A"},
