"561325":{"id":"561325","name":"Pavarotti","slug":"pavarotti","original_title":"Pavarotti","overview":"O Campeonato do Mundo de Futebol de 1990 em Itália foi o momento em que a ópera deixou de ser exclusiva das elites e atingiu as massas. A estrela da ópera Pavarotti juntou-se aos colegas tenores Plácido Domingo e José Carreras no palco em Roma, numa transmissão vista por 1.4 biliões de pessoas no mundo inteiro. A poderosa interpretação de \"Nessun Dorma\" continua a representar uma das mais populares e famosas performances que o mundo alguma vez ouviu, e assim Pavarotti realizou o seu velho sonho de tornar a ópera mainstream. Ron Howard toma uma abordagem íntima para contar a história de Pavarotti, indo para além da icónica figura pública para revelar o homem mesmo.","first_air_date":"2019-06-04","runtime":114,"episode_run_time":[114],"vote_average":7.4,"created_by":["HanWay Films","Imagine Entertainment","White Horse Pictures","Diamond Docs","Imagine Documentaries"],"production_companies":[{"name":"HanWay Films"},{"name":"Imagine Entertainment"},{"name":"White Horse Pictures"},{"name":"Diamond Docs"},{"name":"Imagine Documentaries"}],"cast":["Luciano Pavarotti","Bono","Harvey Goldsmith","Nicoletta Mantovani","Plácido Domingo"],"backdrop_path":"https://image.tmdb.org/t/p/original/7HfN8FedrTiwXHbJpXwMHZFhGyn.jpg","poster_path":"https://image.tmdb.org/t/p/original/bf0Iim4D6XXrAAJGwHXyrWFqUz8.jpg","certification":"N/A","genres":["Documentário","História","Música"],"trailer":"N/A"},
